import axios from "axios";
import { Component } from "react";

export default class PostComponent extends Component
{
    state={
        posts:[],
    };
    render()
    {
        return(

            <>
                <h1>In Post</h1>
                {this.state.posts.map((post,index)=> (
                    <div key={index}>
                        <div>
                            {index+1}.{post.title}
                        </div>
                        <br/>
                    </div>
                ))}
            </>
        )
    }
    componentDidMount()
    {
        axios.get()
    }
}
